import scala.collection.mutable
import scala.collection.mutable.ListBuffer

/**
  * Created by arashid on 14/09/16.
  */
object Crater extends App {

  def level1(in: String) = {
    //    val input = Source.fromFile(s"$path/input.1").getLines.toList.map(_.split(" ").toList)
    val input = in.split(" ").map(_.toInt)
    val rows = input(0)
    val cols = input(1)
    val field = Range(0, rows).map(r => input.slice(2 + cols * r, cols + 2 + cols * r).toList).toList
    val fieldInv = inv(cols, field)
    val y1 = posY(field.zipWithIndex) - 1
    val y2 = posY(field.zipWithIndex.reverse) + 1 - y1
    val x1 = posY(fieldInv.zipWithIndex) - 1
    val x2 = posY(fieldInv.zipWithIndex.reverse) + 1 - x1

    //    printField(field)
    //    printField(fieldInv)
    //    println(field.zipWithIndex)
    //    println(field.zipWithIndex.reverse)
    println(s"$x1 $y1 $x2 $y2")
  }

  def posY(f: Seq[(Seq[Int], Int)]) = f.find(_._1.contains(1)).getOrElse((List(), 0))._2

  def printField(v: Seq[Seq[Int]]) = println(v.map(_.mkString(" ")).mkString("\n"))

  def inv(cols: Int, v: Seq[Seq[Int]]) = Range(0, cols).map(c => v.map(_ (c))).toList

  def level2(in: String): String = {
    val input = in.split(" ").map(_.toInt).toList
    val rows = input(0)
    val cols = input(1)
    val field = Range(0, rows).map(r => input.slice(2 + cols * r, cols + 2 + cols * r)).toList
    val lumosity = input.drop(rows * cols + 3)
    val pairs = lumosity.sliding(2, 2).map { case List(a, b) => (a, b) }.toList.sortBy(_._2).reverse
    val r = pairs.zipWithIndex.drop(1).map(p => {
      val e = edge(p._1._1, field)
      val valid = checkEdge(e, field, pairs.take(p._2).map(_._1))
//      println(s"${p._1._1} <- ${valid.mkString(" ")}")
      if (valid.length == 1) Some(p._1._1, valid(0)) else None
    })

    //    println()
    //    println(pairs)
    //    printField(field)

    var f = field
    r.flatten.foreach(p => {
      f = f.map(l => l.map(i => if (i == p._1 || i == p._2) 1 else 0))
    })
//    printField(f)
//    println()
    val res = s"$rows $cols ${f.flatten.mkString(" ")}"
//    println(res)
    res
  }

  def edge(i: Int, f: Seq[Seq[Int]]) = f.map(_.zipWithIndex.find(_._1 == i))

  def checkEdge(e: Seq[Option[(Int, Int)]], f: Seq[Seq[Int]], vals: List[Int]) = {
    val t = e.zipWithIndex.filter(_._1.isDefined).map(p => (p._1.get, p._2))
    vals.map(v => if (t.map(p => f(p._2).take(p._1._2).contains(v)).forall(_ == true)) v else -1).filter(_ != -1)
  }

  def level3(in: String): String = {
    val input = in.split(" ").map(_.toInt).toList
    val rows = input(0)
    val cols = input(1)
    val field = Range(0, rows).map(r => input.slice(2 + cols * r, cols + 2 + cols * r)).toList

    var index = 1
    val areas = field.flatten.toSet.filter(_ != 0)
    val groups: mutable.Map[Int, List[(Int, (Int, Int))]] = mutable.Map(index -> List())
    areas.foreach(a => {
      val idx = field.zipWithIndex.flatMap(l => l._1.zipWithIndex.map(v => (v._1, (l._2, v._2))).filter(_._1 == a))
//      println(idx)
      val buf: ListBuffer[(Int, (Int, Int))] = idx.to[ListBuffer]
      while (buf.nonEmpty) {
        groups(index) = List(buf.head)
        buf -= buf.head
        index += 1
        var lastSize = 0
        while (buf.size != lastSize) {
          lastSize = buf.size
          buf.foreach(i => {
            val g = groups.find(g => g._2.exists(p => checkPos(i._2, p._2)))
            if (g.isDefined) {
              buf -= i
              groups(g.get._1) = i :: g.get._2
            }
          })
        }
      }
//      println(groups)
    })

//    printField(field)

    val matrix = Array.ofDim[Int](rows, cols)
    groups.foreach(kv => kv._2.foreach(v => matrix(v._2._1)(v._2._2) = kv._1))
//    println(groups)

    val p = groups.map(p => (p._1, p._2.head._1)).map(p => s"${p._1} ${p._2}")
    val f = matrix.map(_.toList).toList
    val res = s"$rows $cols ${f.flatten.mkString(" ")} ${groups.size} ${p.mkString(" ")}"
//    println(res)
    res
  }

  def checkPos(x: (Int, Int), y: (Int, Int)) = {
    (x._1 == y._1 && (x._2 + 1 == y._2 || x._2 - 1 == y._2)) ||
      (x._2 == y._2 && (x._1 + 1 == y._1 || x._1 - 1 == y._1))
  }

